import { ActionType } from "../constant/productConstant";

const initialState = [
  {
    product: [
      {
        title: "Brand",
        id: 1,
      },
    ],
  },
];
export const ProducrReducer = (state = initialState, { type, payload }) => {
  switch (type) {
    case ActionType.SET_PRODUCT:
      return state;
    default:
      return state;
  }
};
